def calculate_moves(n):
    moves = 0
    while n > 1:
        if n % 5 == 0:
            n = math.floor(4 * n / 5)
        elif n % 3 == 0:
            n = math.floor(2 * n / 3)
        elif n % 2 == 0:
            n = math.floor(n / 2)
        else:
            return -1
        moves += 1
    return moves

